import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import { Routes } from "./Routes/routes";

import Admin from './pages/Admin/Admin';


function App() {
  return (
    <div className="App">

      <Router>

        <Admin />
        <Routes />

      </Router>
    </div>
  );
}

export default App;
